//CLICK EVENT FOR PRINT PRODUCTLIST--------------------------------------------------------------------------------
$(".Productlist-printbtn").click(() => {
    let image = "data:image/jpeg;base64,";
    
    let category = $(".Productlist-print-category").val();
    const addzero_report = (num) => {
        return num < 10 ? `0${num}`:num;
    };
    let now = new Date();
    let month = now.getMonth() + 1;
    let date = now.getDate();
    let year = now.getFullYear();
    let hours = addzero_report(now.getHours());
    let mins = addzero_report(now.getMinutes());
    let period = hours >= 12 ? 'PM' : 'AM';
    hours = hours % 12;
    hours = hours ? hours : 12;
    let report_date = `${month}/${date}/${year} ${hours}:${mins} ${period}`;
    let array_data = [];

//GENERATE REPORT PRODUCTLIST
const generate_report = (array_data,filename) => {
    let doc = new jspdf.jsPDF('p', 'mm', [216, 279]);
    const textcenter = (text) => {
        let textWidth = doc.getStringUnitWidth(text) * doc.internal.getFontSize() / doc.internal.scaleFactor;
        return (doc.internal.pageSize.width - textWidth) / 2;
    };
    doc.autoTable({
        body: array_data,
        columns: [
            { header: "Code", dataKey: "Code" },
            { header: "ProductName", dataKey: "ProductName" },
            { header: "Category", dataKey: "Category" },
            { header: "BrandName", dataKey: "BrandName" },
            { header: "Formulation", dataKey: "Formulation" },
            { header: "Price", dataKey: "Price" },
          ],
        margin: {top: 57},
        bodyStyles: {lineColor: [0,0,0],halign: "left",valign: "middle",font: "helvetica",textColor: [0,0,0],fontSize: 10,fontStyle: "normal",fillColor: [255,255,255],lineColor: [0,0,0],lineWidth: 0.2},
        headStyles: {halign: "center",valign: "middle",font: "helvetica",textColor: [0,0,0],fontSize: 12,fontStyle: "bold",fillColor: [255,255,255],lineColor: [0,0,0],lineWidth: 0.2},
        theme: 'plain',
    });
    let pagenumber = doc.internal.getNumberOfPages();
    for(let i = 0; i < pagenumber; i++){
        doc.setPage(i);
        doc.setFont("Helvetica","bold");
        doc.setFontSize(18);
        doc.addImage(image,"JPEG",25,8,30,30);
        doc.text("PHARMACY MANAGEMENT",textcenter("PHARMACY MANAGEMENT"), 13);
        doc.text("PROCESS SYSTEM",textcenter("PROCESS SYSTEM"),23);
        doc.text(report_date,textcenter(report_date),33);
        doc.setFontSize(20);
        doc.text("PRODUCTLIST REPORT",textcenter("PRODUCTLIST REPORT"),53);
    }
    doc.autoPrint();
    doc.output('dataurlnewwindow',filename);
    doc.save(filename);
    doc = new jspdf.jsPDF('p', 'mm', [216, 279]);
    }
    const all_product = () => {
        for(let i = 0; i < ArrayGetAllProduct.length;i++){
            let code = ArrayGetAllProduct[i].code;
            let productname = ArrayGetAllProduct[i].productname;
            let category = ArrayGetAllProduct[i].category;
            let brandname = ArrayGetAllProduct[i].brandname;
            let formulation = ArrayGetAllProduct[i].formulation;
            let price = ArrayGetAllProduct[i].price;
            array_data.push([code,productname,category,brandname,formulation,price]);
        }
        generate_report(array_data,"allproduct-productlist.pdf");
    }
    
    const print_product = (category) => {
        for(let i = 0; i < ArrayGetAllProduct.length;i++){
            let code = ArrayGetAllProduct[i].code;
            let productname = ArrayGetAllProduct[i].productname;
            let Acategory = ArrayGetAllProduct[i].category;
            let brandname = ArrayGetAllProduct[i].brandname;
            let formulation = ArrayGetAllProduct[i].formulation;
            let price = ArrayGetAllProduct[i].price;
            Acategory == category ? array_data.push([code,productname,category,brandname,formulation,price]) : null;
        }
        generate_report(array_data,`${category}-productlist.pdf`);
    }
    
    (category == "All") ? all_product() : print_product(category);
        
}); 
